import React from 'react'
import {BrowserRouter, Routes, Route} from 'react-router-dom';
import Updates from './comp/Updates';
import Footer from './comp/footer';
import Details from './Details'; 
// import CreateUser from './comp/CreateUser';



////css import
import EditUser from './comp/EditUser';
// import Logo from './comp/logo';
import Update from './comp/update';

function Home(){
   return(
       <>
       
       <BrowserRouter>
        <Routes>
         <Route index element={<Home />} />
         <Route path="user" element={<Details />} /> 
         <Route path="user/:id/edit" element={<EditUser />} /> 
         <Route path="user/list" element={<Updates/>} />
         {/* <Route path="user/:id/edit" element={<Details/>} /> */}
       </Routes>
       <Update/>
       <Footer/>
       </BrowserRouter>
</>
)}
export default Home
